import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


function App() {
  return (

  <Router>
    <div>
      <h1>Prueba</h1>
    </div>
    <Switch>
      <Route path="/hola">
        <h1>
          <h1>Hola</h1>
        </h1>


      </Route>
    </Switch>


  </Router>
  );
}


export default App;
